#--------------------------------------------------------------------------------
# 글로벌 유니크 아이디 속성.
# - 태그의 속성으로 {8-4-4-12} 영어대문자+숫자 조합 형식인 GUID 표준 형태의 고유식별자 코드를 의미.
#--------------------------------------------------------------------------------
class GuidAttribute:
	#--------------------------------------------------------------------------------
	# 멤버 변수 목록.
	#--------------------------------------------------------------------------------
	Value: str


	#--------------------------------------------------------------------------------
	# 문자열 변환 오퍼레이터.
	#--------------------------------------------------------------------------------
	def __str__(thisInstance) -> str:
		return f"{{{thisInstance.Value}}}"